import React from 'react';
import Header from './Header';
import Inventory from './Inventory';
import Order from './Order';

class App extends React.Component {
  state = {
    fishes: {},
    order: {}
  }

  AddFish = (fish) => {
    console.log('Adding a fish!!');
  }
  render() {
    return (
     <div className="catch-of-the-day">
       <div className="menu">
         <Header />
       </div>
       <Order />
       <Inventory />
     </div>
    )
  }
}

export default App;
